import React from "react";

function Projects() {
  return (
    <div className="bg-gradient-to-r from-[#F6AE2D] to-[#F48923]">
      <h2 className="text-2xl text-center m-auto">Projects</h2>
      <div className="flex flex-wrap flex-row my-mx-auto justify-center align-center">
        <div className="p-5 m-1 border-2 rounded-md bg-white">
          Crypto Portal
        </div>
        <div className="p-5 m-1 border-2 rounded-md bg-white">
          Budget Tracker
        </div>
        <div className="p-5 m-1 border-2 rounded-md bg-white">
          Unrekt Crypto Tracker
        </div>
      </div>
    </div>
  );
}

export default Projects;
